script: |
  super -f text -I q3561.spq | sort > q3561.out

inputs:
  - name: q3561.spq
    data: |
      SELECT DISTINCT + 56 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 BETWEEN - col2 * CAST ( + 49 AS REAL ) * + col0 + + col1 AND + col2 * - col2 + + col0 - - col0 - CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q3561.out
    data: |
